import React from "react";

function Hero() {
  return (
    <div className=" bg-[url('https://images.unsplash.com/photo-1515704089429-fd06e6668458?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=314&ixid=MnwxfDB8MXxyYW5kb218MHx8Y29tcHV0ZXJ8fHx8fHwxNjgwNTY0Mjk5&ixlib=rb-4.0.3&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=600')] bg-local text-basefont">
      <div className="mt-24 flex h-screen flex-col items-center">
        <p className="text-2xl font-bold uppercase text-primary">Growing Together</p>
        <h1 className="font-bold">Grow With Data</h1>
        <div>
          <p className="font-bold">Fast, Flexible and Great</p>
        </div>
      </div>
    </div>
  );
}

export default Hero;
